import requests

# URL de la API a la que deseas realizar la solicitud POST
url = 'https://apivp.efacturacadena.com/staging/vp/documentos/proceso/sincrono'

# Datos para enviar en el cuerpo de la solicitud (opcional)
payload = ""

# Par치metros de cabecera
headers = {
    'Content-Type': 'text/plain',  # Ejemplo de cabecera con tipo de contenido JSON
    'efacturaAuthorizationToken': '251cfaa7-5b0c-4f93-9610-d626a9a54b9a'  # Ejemplo de cabecera de autorizaci칩n con un token
}

# Realizar una solicitud POST con los datos y cabeceras especificados
response = requests.post(url, json=payload, headers=headers)

# Comprobar el c칩digo de respuesta de la solicitud
if response.status_code == 200:
    # La solicitud fue exitosa
    datos_respuesta = response.json()  # Obtener los datos de la respuesta en formato JSON
    print(datos_respuesta)
else:
    # La solicitud fall칩
    print('Error en la solicitud:', response.status_code)